PI = 3.14159265
SIDE = 0.57735
WIDTH = 1.1547
SLIDE = 0.28868
LOOP = 1.73205
#SIDE + WIDTH = LOOP
#
#
# |  WIDTH  |
# |  _____ _|_____
# | /     \ |   |
# |/       \|__ |1
# |\       /0.5 |
# |S\_____/_____|_
# |L|     |
# |I|SIDE |
# |D|
# |E|

def hexout(X,Y,vert):
    if (X-SLIDE*vert)%LOOP< WIDTH*(1-vert)+SIDE*vert:
        #column 1
        return([2*int(X/LOOP+SLIDE+1)-2,int(0.5+Y)-1])
    else:
        #column 2
        return([2*int(X/LOOP-SLIDE+1)-1,int(Y)])

def hexout2(X,Y,vert):
    if (X-SLIDE*vert)%LOOP< WIDTH*(1-vert)+SIDE*vert:
        return([((X%LOOP)/WIDTH),(Y+0.5)%1])
    else:
        return([(((X+SLIDE+SIDE)%LOOP)/WIDTH),Y%1])
    #cord=[((X%LOOP)/WIDTH),(Y+0.5)%1]    cord=[(((X+SLIDE+SIDE)%LOOP)/WIDTH),Y%1]

def main():

    pics = []
    imgsize = []
    for i in picsUnloaded:
        leeImg = Image.open(i + ".png")
        pics += [leeImg.load()]
        imgsize += [leeImg.size]

    detailsImg = []
    detailsize = []
    for i in detailsUnloaded:
        leeImg = Image.open(i + ".png")
        detailsImg += [leeImg.load()]
        detailsize += [leeImg.size]

    outsize = [int(((len(BOARD[0]))*LOOP+SIDE)*HEXSIZE/2),int((len(BOARD)+0.5)*HEXSIZE)]

